script: |
  super -f text -I q8326.spq | sort > q8326.out

inputs:
  - name: q8326.spq
    data: |
      SELECT - COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1 WHERE NOT 21 IS NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q8326.out
    data: |
      -9
